import React from 'react';
import Cards from './Cards';

function Cardslist(props){
    const cards=props.posters.map
    ((obj)=>
        <Cards img={obj.image}/>
    );

    return (
        <>
        {cards}

        </>
    );
}

export default Cardslist;
